import React from "react";
import OfferCardItem from "../../Offer/cards/OfferCardItem";


export default function ListOffers ({offers, withStatus}) {
    if(!offers) offers = []

    return (
        <div className="row">
            {offers.map((item, key) => {
                return (
                    <div key={key} className="col-xs-6">
                        <OfferCardItem
                            offer={item}
                            withStatus={withStatus}
                        />
                    </div>
                )
            })}
        </div>
    );
}
